    true,nt"url": null,nt"notes": "ZIP Code Business Patterns (ZBP)rnrn County
    Business Patterns (CBP) is an annual series that provides subnational economic data
    by industry. This series includes the number of establishments, employment during
    the week of March 12, first quarter payroll, and annual payroll. This data is useful
    for studying the economic activity of small areas; analyzing economic changes over
    time; and as a benchmark for other statistical series, surveys, and databases between
    economic censuses. Businesses use the data for analyzing market potential, measuring
    the effectiveness of sales and advertising programs, setting sales quotas, and developing
    budgets. Government agencies use the data for administration and planning.",nt"license_title":
